//kubi.zone/docs/v0.1.0/operators/zonefile/":{"tf":1.0}},"df":3}}}},"r":{"docs":{},"df":0,"e":{"docs":{},"df":0,"c":{"docs":{},"df":0,"o":{"docs":{},"df":0,"r":{"docs":{},"df":0,"d":{"docs":{"https://kubi.zone/docs/v0.1.0/custom-resources/record/":{"tf":1.0}},"df":1}}}},"s":{"docs":{},"df":0,"o":{"docs":{},"df":0,"u":{"docs":{},"df":0,"r":{"docs":{},"df":0,"c":{"docs":{"https://kubi.zone/docs/v0.1.0/custom-resources/":{"tf":1.0}},"df":1}}}}}}},"s":{"docs":{},"df":0,"t":{"docs":{},"df":0,"a":{"docs":{},"df":0,"r":{"docs":{},"df":0,"t":{"docs":{"https://kubi.zone/docs/v0.1.0/getting-started/":{"tf":1.0}},"df":1}}}}},"u":{"docs":{},"df":0,"s":{"docs":{},"df":0,"a":{"docs":{},"df":0,"g":{"docs":{"https://kubi.zone/docs/v0.1.0/getting-started/usage/":{"tf":1.0}},"df":1}}}},"v":{"docs":{},"df":0,"0":{"docs":{},"df":0,".":{"docs":{},"df":0,"1":{"docs":{},"df":0,".":{"docs":{},"df":0,"0":{"docs":{"https://kubi.zone/docs/v0.1.0/":{"tf":1.0}},"df":1}}}}}},"z":{"docs":{},"df":0,"o":{"docs":{},"df":0,"n":{"docs":{},"df":0,"e":{"docs":{"https://kubi.zone/docs/v0.1.0/custom-resources/zone/":{"tf":1.0}},"df":1,"f":{"docs":{},"df":0,"i":{"docs":{},"df":0,"l":{"docs":{"https://kubi.zone/docs/v0.1.0/custom-resources/zonefile/":{"tf":1.0},"https://kubi.zone/docs/v0.1.0/operators/zonefile/":{"tf":1.0}},"df":2}}}}}}}}}},"documentStore":{"save":true,"docs":{"https://kubi.zone/":{"body":"","id":"https://kubi.zone/","title":"Manage DNS in Kubernetes"},"https://kubi.zone/docs/":{"body":"","id":"https://kubi.zone/docs/","title":"docs"},"https://kubi.zone/docs/v0.1.0/":{"body":"","id":"https://kubi.zone/docs/v0.1.0/","title":"v0.1.0"},"https://kubi.zone/docs/v0.1.0/custom-resources/":{"body":"","id":"https://kubi.zone/docs/v0.1.0/custom-resources/","title":"Custom Resources"},"https://kubi.zone/docs/v0.1.0/custom-resources/record/":{"body":"The latest version of the Record's Custom Resource Definition can be found here\nWhat is a Record?\nA DNS Record is a single named entry within a zone.\nExamples\nA fully qualified DNS record:\napiVersion: kubi.zone/v1alpha1\nkind: Record\nmetadata:\n  name: www-subdomain-example-org\nspec:\n  domainName: www.subdomain.example.org.\n  type: A\n  rdata: \"192.168.0.2\"\n\nOn its own this Record won't be very useful, but assuming a Zone matching the record's\nfully qualified domainName, which allows delegation of this domain name exists, the record will be\nincorporated into it, and from there be consumed by downstream providers.\n\nA partial record, referencing a parent zone by name:\napiVersion: kubi.zone/v1alpha1\nkind: Record\nmetadata:\n  name: www-subdomain-root\nspec:\n  domainName: www.subdomain\n  zoneRef:\n    name: root-zone\n  type: A\n  rdata: \"192.168.0.1\"\n\nUsing partial domain names and a zoneRef instead of fully qualified ones, allows you to change\nthe top-level domain without editing the domainName across all records, or to define records\nwithout knowledge of the super-zone. This is useful for deployments of application where only\nthe relative subdomain is relevant, such as static.&lt;mydomain&gt; or blog.&lt;top-domain&gt;.\n\nBoth of the above examples assumes the presence of a zone like the one defined below. Note that the zone explicitly allows delegation of the www.subdomain domain\nto any record by not imposing limits on the namespace, class or type of the record.\napiVersion: kubi.zone/v1alpha1\nkind: Zone\nmetadata:\n  name: root-zone\nspec:\n  domainName: example.org.\n  delegations:\n  - records:\n    - pattern: [\"*.subdomain.example.org.\"]\n\nSpecification\nThe Record's .spec is made up of the following fields:\n.spec.domainName string\nEither a fully-qualified domain name such as www.example.org. (notice the trailing dot), or\na partial domain name (the name is only a partial name, such as the www in www.example.org.) in\nwhich case the .spec.zoneRef field must be populated.\nIf using a fully qualified domain name, the Kubizone operator will\nautomatically attempt to deduce which parent Zone the record belongs to, favoring\nthe longest matching parent domain name.\nRegardless of the domain name type, the operator will respect the parent zone delegations.\n.spec.type string\nType of record. See a list here for examples.\nNo validation is performed on this field, limitations are only imposed by downstream providers.\n.spec.rdata string\nContents of the record. In the case of A records, this will be the IP address.\nIn the case of an NS record, this will be the hostname of the nameserver.\nFor MX it will be the preference and exchange expressed as a string, e.g.: 10 mail.protonmail.ch.\n.spec.ttl u32\nTime-to-live for the record. If none is set the parent zone's default will be used, which in turn defaults to 360 seconds.\n.spec.class string\nCan also be set, but defaults to IN.\nStatus\nThe record status only contains the fully qualified domain name of the record.\n.status.fqdn string\nIf the zone has been defined using a fully qualified domainName, then .status.fqdn will simply reflect the .spec.domainName.\nIf not, then the Kubizone Operator will automatically deduce the fully qualified domain name for the record, by following and concatenating domain names of the parent zones as defined by the zoneRefs until a fully qualified domain name is constructed.\n","id":"https://kubi.zone/docs/v0.1.0/custom-resources/record/","title":"Record"},"https://kubi.zone/docs/v0.1.0/custom-resources/zone/":{"body":"The latest version of the Zone's Custom Resource Definition can be found here\nWhat is a Zone?\nIn DNS terms, a Zone defines a subset of the DNS namespace.\nZones can either be defined as \"standalone\", or sub-zones of other Zone resources within the cluster.\nExamples\nA zone can either represent a standalone domain with a Fully Qualified Domain Name (FQDN) as in this example:\napiVersion: kubi.zone/v1alpha1\nkind: Zone\nmetadata:\n  name: example-org\nspec:\n  # Fully qualified domain name (notice the trailing dot.)\n  domainName: example.org.\n  delegations:\n  - zones: [\"subdomain.example.org.\"]\n    # If you want to delegate sub-zones or records\n    # to specific namespaces, you can specify a namespace\n    # field like below. By default, delegations implicitly\n    # allow delegation to any namespace.\n    # namespace: subdomain-namespace\n\n\nOr be a sub-zone of another parent Zone using a zoneRef:\napiVersion: kubi.zone/v1alpha1\nkind: Zone\nmetadata:\n  name: subdomain-example-org\nspec:\n  # This is a sub-zone of the example-org zone as defined below\n  # by the zoneRef, and therefore ust not be a fully qualified\n  # domain name (no trailing dot).\n  domainName: subdomain\n  zoneRef:\n    # Name refers to the .metadata.name of the zone we created above.\n    name: example-org\n    # namespace: other-namespace\n  delegations:\n  - records:\n    # In this case we don't necessarily know what the example-org zone's\n    # fully qualified domain name is, it could change to `test.org.` tomorrow\n    # using the @-symbol here means match whatever *our* Zone's FQDN is,\n    # taking into account the FQDN of our parent, and their parents, and so on.\n    - pattern: \"*.@\"\n      # Optionally specify which types of records are allowed to be delegated\n      # types: [\"A\", \"CNAME\"]\n  # Delegate dev.subdomain.example.org. to the dev namespace\n  - namespace: dev\n    zones:\n    - \"dev.@\"\n  # Delegate staging.subdomain.example.org to the staging namespace\n  - namespace: staging\n    zones:\n    - \"staging.@\"\n\n\nOr you can use a fully qualified domain name for your sub-zone which the Kubizone Operator will automatically associate with the parent zone, if the delegation rules allow it:\napiVersion: kubi.zone/v1alpha1\nkind: Zone\nmetadata:\n  name: subdomain-example-org\nspec:\n  # Fully qualified domain name (notice the trailing dot.)\n  domainName: subdomain.example.org.\n  delegations:\n  - records:\n    - pattern: \"*.subdomain.example.org.\"\n\nSpecification\nThe Zone's .spec is made up of the following fields:\n.spec.domainName string\nEither a fully-qualified domain name such as subdomain.example.org. (notice the trailing dot), or\na partial domain name (the name is only a partial name, such as the dev in dev.example.org.) in\nwhich case the .spec.zoneRef field must be populated.\nIf using a fully qualified domain name, the Kubizone Operator will\nautomatically attempt to deduce which parent Zone the record belongs to, favoring\nthe longest matching parent domain name.\nRegardless of the domain name type, the operator will respect the parent zone delegations.\nNote that either .spec.zoneRef or a fully qualified .spec.domainName must be used.\n.spec.zoneRef\na ZoneRef object has just two fields: .spec.zoneRef.name and optionally .spec.zoneRef.namespace,\nand is used to refer to a zone by its kubernetes .metadata.name.\nIf the zone exists within a different namespace than the one from which it is being referenced,\nthe .spec.zoneRef.namespace field must also be specified.\nNote that either .spec.zoneRef or a fully qualified .spec.domainName must be used.\n.spec.delegations\nList of rules by which records and sub-zones can be adopted by this zone.\nEach rule is made up of the following optional fields:\n\n\nrecords [RecordDelegation]: List of record delegations to allow.\nEach record delegation in turn has the fields:\n\n\ntypes, a list of record types to delegate (A, CNAME, etc.)\n\n\npattern, a simple pattern for matching domain names.\nAllows wildcards * for matching entire domain name segments (the parts between dots)\nboth at the beginning, middle and end of domain names.\nCan use @ as a short-hand for this Zone's fully qualified domain name, if it is\nsubject to change or unknown at the time of creation.\n\n\n\n\nzones: List of sub-zone FQDNs to allow delegation to.\nAllows wildcards * for matching entire domain name segments (the parts between dots)\nboth at the beginning, middle and end of domain names.\nCan use @ as a short-hand for this Zone's fully qualified domain name, if it is\nsubject to change or unknown at the time of creation.\n\n\nnamespace: Limit the above rules to a singular namespace.\n\n\n.spec.ttl u32\nSet a default Time-To-Live (TTL) value across the zone, which will be used if records don't specify one\nthemselves.\nDefaults to 360 seconds, to increase cache responsiveness.\n.spec.refresh u32\nNumber of seconds after which secondary name servers should query the master for the SOA record,\nto detect zone changes. \nDefaults to the recommendation for small and stable zones: 86400 seconds (24 hours).\n.spec.retry u32\nNumber of seconds after which secondary name servers should retry to request the serial number from the master if the master does not respond.\nIt must be less than .spec.refresh.\nDefaults to the recommendation for small and stable zones: 7200 seconds (2 hours).\n.spec.expire u32\nNumber of seconds after which secondary name servers should stop answering request for this zone if the master does not respond.\nThis value must be bigger than the sum of .spec.refresh and .spec.retry.\nDefaults to recommendation for small and stable zones: 3600000 seconds (1000 hours).\n.spec.negativeResponseCache u32\nUsed in calculating the Time-To-Live (TTL) for purposes of negative caching.\nAuthoritative name servers take the smaller of the SOA TTL and this value to send as the SOA TTL in negative responses.\nResolvers use the resulting SOA TTL to understand for how long they are allowed to cache a negative response.\nRecommendation for small and stable zones: 172800 seconds (2 days).\nDefaults to a much lower value (360 seconds) to increase cache responsiveness and reduce failed lookups to records still being provisioned.\nStatus\nThe Zone status contains the fully qualified domain name of the Zone, a composite list of all discovered child records and zones,\nas well as a hash value of these records, which can be used by downstream providers to easily detect changes.\n.status.entries\nContains a composite list of all child records successfully adopted by this zone, any NS and related glue records (A and AAAA records) of sub-zones, as well as an SOA record for the zone, utilizing the variables defined in the .spec.\nEach entry contains:\n\nfqdn string\ntype string\nclass string\nttl u32\nrdata string\n\nChanges in immediate child records, as well as changes to NS and related glue records (A and AAAA records) of sub-zones\ncauses the entries list to be re-populated.\n.status.fqdn string\nIf the zone has been defined using a fully qualified domainName, then .status.fqdn will simply reflect the .spec.domainName.\nIf not, then the Kubizone Operator will automatically deduce the fully qualified domain name for the zone, by following and concatenating domain names of the parent zones as defined by the zoneRefs until a fully qualified domain name is constructed.\n.status.hash string\ncontains a hash of the zone and its constituent parts, computed based on the .status.entries field.\nChanges to the .status.entries list causes the hash to be recomputed.\n","id":"https://kubi.zone/docs/v0.1.0/custom-resources/zone/","title":"Zone"},"https://kubi.zone/docs/v0.1.0/custom-resources/zonefile/":{"body":"The latest version of the ZoneFile's Custom Resource Definition can be found here\nWhat is a ZoneFile?\nWithin the Domain Name System a Zone file is a text file representation of a DNS zone.\nWithin the context of Kubizone, a ZoneFile resource describes a way for the Zonefile Operator\nto produce ConfigMaps containing the text representations\nof the Records and Zones defined within the cluster.\nExamples\nThe following manifest instructs the Zonefile Operator to produce a ConfigMap describing the\nZone named example-org, and by extension all Records\nand sub-zones associated with it.\napiVersion: kubi.zone/v1alpha1\nkind: ZoneFile\nmetadata:\n  name: example\nspec:\n  zoneRefs:\n  - name: example-org\n\n\nzoneRefs is a list of zones to include in the resulting ConfigMap.\nEach zone gets its own file/entry in the ConfigMap. For example, the following ZoneFile definition:\napiVersion: kubi.zone/v1alpha1\nkind: ZoneFile\nmetadata:\n  name: example-zonefile\nspec:\n  zoneRefs:\n  - name: example-org\n  - name: dev-example-org\n    namespace: dev\n\nWould produce a configmap with the following structure:\napiVersion: v1\nkind: ConfigMap\nmetadata:\n  name: example-zonefile\ndata:\n  example.org.: |-\n    $ORIGIN example.org.\n\n    (...)\n  dev.example.org.: |-\n    $ORIGIN dev.example.org.\n\n    (...)\n\nAssuming the example-org refers to a zone with the fully qualified domain name example.org., and dev-example-org\nlikewise represents a Zone with an FQDN of dev.example.org.\nSpecification\n.spec.zoneRefs\nList of zoneRefs to include in the ConfigMap.\nEach zoneRef must include the name parameter, and optionally a namespace parameter if the target Zone\nis in a separate namespace from this one.\n.spec.configMapName string\nOptionally override the name of the resulting ConfigMap. By default, the Zonefile Operator will produce configmaps with the same name as the ZoneFile resource itself.\nStatus\nReflects the last observed hashes and serials for each of its constituent zones, primarily for troubleshooting purposes.\n.status.hash string\nMap of FQDNs to latest observed hash for the zone.\n.status.serial u32\nMap of FQDNs to latest observed serial for the zone.\n","id":"https://kubi.zone/docs/v0.1.0/custom-resources/zonefile/","title":"ZoneFile"},"https://kubi.zone/docs/v0.1.0/getting-started/":{"body":"","id":"https://kubi.zone/docs/v0.1.0/getting-started/","title":"Getting Started"},"https://kubi.zone/docs/v0.1.0/getting-started/installation/":{"body":"The easiest way to install Kubizone and jump right into managing zones, is to install the Helm Chart.\nCustom Resource Definitions\nBecause of the lack of real support for managing Custom Resource Definitions using Helm Charts,\nyou will have to install these manually first:\n$ kubectl apply -f https://raw.githubusercontent.com/kubi-zone/kubi.zone/main/crds/kubi.zone/v1alpha1/Record.yaml\n$ kubectl apply -f https://raw.githubusercontent.com/kubi-zone/kubi.zone/main/crds/kubi.zone/v1alpha1/Zone.yaml\n\nIf you want to make use of the Zonefile Operator to generate zonefile ConfigMaps,\nyou also have to install the ZoneFile CRD:\n$ kubectl apply - f https://raw.githubusercontent.com/kubi-zone/kubi.zone/main/crds/kubi.zone/v1alpha1/ZoneFile.yaml\n\nDeploying the chart\nAdd the Helm repository\n$ helm repo add kubizone https://charts.kubi.zone/\n\nInstall the chart\n$ helm install -n kube-system kubizone kubizone/kubizone\n\nPlease see the values.yaml file for a list of available configuration options.\n","id":"https://kubi.zone/docs/v0.1.0/getting-started/installation/","title":"Installation"},"https://kubi.zone/docs/v0.1.0/getting-started/integrating/":{"body":"This section is only for developers who want to create an integration for Kubizone\nto some currently (or poorly) unsupported provider.\nThe easiest way to integrate with Kubizone, is to write a program which\nreads the Zone resources directly from the \nKubernetes API, and pushes/applies these changes directly to the DNS provider\nthrough an API.\nIf your provider supports uploading RFC1035-compatible\ntext representations of a zone, it might be easier to use the ZoneFile's\nconfigmaps instead.\nYou can retrieve a list of current records associated with a zone by reading\nthe .status.entries field of the zone, and use this list to populate the\nzone as defined by your provider.\nPlease see usage and Zone to get\nan idea for how zones and records interact, as well as the structure of it.\nExample Provider\nA very simple provider has been implemented for AWS' Route53 in bash, using\njust kubectl and the aws cli.\nThe provider is available here\n","id":"https://kubi.zone/docs/v0.1.0/getting-started/integrating/","title":"Integrating"},"https://kubi.zone/docs/v0.1.0/getting-started/introduction/":{"body":"Kubizone delivers Kubernetes-native Domain Name System (DNS) primitives such as \nRecords and Zones,\nand employs an operator to ensure that associations between Records and Zones\nare kept up to date, and that Zones' Delegation rules\nare respected.\nPurpose\nKubizone aims to be a more flexible and versatile replacement for projects such as\nexternal-dns.\nInstead of building providers into Kubizone itself like external-dns does, Kubizone instead\nexposes a very simple interface in the form of Records and\nZones, which custom providers in turn can use to update external\nDNS provider state.\nThese custom resources makes Kubizone a lot more powerful than external-dns, which by its\ndesign is limited to exposing Service and Ingress resources via A and AAAA records, allowing\nKubizone to represent all kinds of DNS Records, including but not limited to: SRV, NS, CNAME, and so on.\nOverview\nBy default, Kubizone deploys the following Custom Resources:\n\n\nRecord, represents a single DNS Record entry, A, AAAA, CNAME, what have you.\n\n\nZone can be a top-level domain or even a subdomain of another.\n\n\nZoneFile is used by the ZoneFile Operator to produce\nRFC1035-compatible zonefile ConfigMaps which can be used with bind servers such as CoreDNS.\n\n\nAnd the following Operators:\n\n\nKubizone Operator monitors all Records\nand Zones cluster-wide, keeping track of associations between them,\nand enriching them with all the information necessary for downstream providers to maintain\nexternal state, such as serials, zone hashes, compiled list of child records, etc.\n\n\nZonefile Operator monitors Zonefiles\nand Zones, compiling them into RFC1035-compatible\nConfigMaps which can then either be mounted directly into a CoreDNS (or similar) container and served,\nor pushed to an external DNS provider.\nThis operator also acts as an example of a downstream provider, whose only interaction with the rest of the Kubizone project\nis as a passive observer of zone changes.\n\n\nDeveloping\nIf you're interested in building a custom provider integration for Kubizone, take a look at the Custom Resources\nand get to work!\nBecause of the architecture of Kubizone, your controller doesn't need to coordinate or embed itself in\nKubizone to be useful.\nInstead, independent providers can simply run -- inside or outside -- of the cluster, watching for zone or\nrecord changes, and acting accordingly.\nIn fact, this design allows multiple providers to co-exist, meaning you can easily mirror\nyour entire configuration, allowing you to easily fail over to a secondary authority in case of an outage.\n","id":"https://kubi.zone/docs/v0.1.0/getting-started/introduction/","title":"Introduction"},"https://kubi.zone/docs/v0.1.0/getting-started/usage/":{"body":"Once you have completed the installation, you can start building out your Zones and Records,\nthe same way you do all your other Kubernetes Resources.\napiVersion: kubi.zone/v1alpha1\nkind: Zone\nmetadata:\n  name: example-org\n  namespace: my-namespace\nspec:\n  domainName: example.org.\n  delegations:\n  - namespace: my-namespace\n    records: [\"*.example.org.\"]\n\nThis zone will automatically adopt any Records within its own namespace (my-namespace), so let's create one.\nWe'll start with our website's main home page:\napiVersion: kubi.zone/v1alpha1\nkind: Record\nmetadata:\n  name: www-example-org\n  namespace: my-namespace\nspec:\n  domainName: www.example.org.\n  type: A\n  rdata: \"192.168.0.2\"\n\nWe're relying on the Kubizone Operator's ability to discern that these two are related\nbased solely on their fully qualified domainNames, and since our zone explicitly allows delegation of any sub-domain\nrecord to this namespace, it will be automatically included.\nUsing kubectl get zone -n my-namespace example-org -o yaml should produce something similar to this:\napiVersion: kubi.zone/v1alpha1\nkind: Zone\nmetadata:\n  name: example-org\n  namespace: my-namespace\nspec:\n  delegations:\n  - namespaces: [\"my-namespace\"]\n    records:\n    - pattern: '*.example.org.'\n      types: []\n    zones: []\n  domainName: example.org.\n  expire: 3600000\n  negativeResponseCache: 360\n  refresh: 86400\n  retry: 7200\n  ttl: 360\nstatus:\n  entries:\n  - class: IN\n    fqdn: www.example.org.\n    rdata: 192.168.0.2\n    ttl: 360\n    type: A\n  fqdn: example.org.\n  hash: \"3820432254183799767\"\n  serial: 2023110206\n\nThe interesting bit is the .status.entries field, which now contains our record! This is the field\nthat the Zonefile Operator or other integrations will use to populate a text\nrepresentation of the zonefile, push the configuration to a DNS provider, or whatever else they might\nwant.\n","id":"https://kubi.zone/docs/v0.1.0/getting-started/usage/","title":"Usage"},"https://kubi.zone/docs/v0.1.0/operators/":{"body":"","id":"https://kubi.zone/docs/v0.1.0/operators/","title":"Operators"},"https://kubi.zone/docs/v0.1.0/operators/kubizone/":{"body":"Monitoring of Zones and Records are independent processes, as described below.\nBoth Zones and Records\nacross the entire cluster are monitored for changes.\nZones\nWhenever a Zone resource change is detected, the following process occurs:\n\n\nPopulate the zone's .status.fqdn.\nIf the Zone has a fully qualified domainName, this field is copied directly.\nIf not, the zone's parent is retrieved by following its zoneRef after which the .status.fqdn is\npopulated by concatenating the domainName of the child zone with the .status.fqdn of the parent. \nIf the parent zone's .status.fqdn is not populated, the operator will stop and requeue the update,\non the assumption that it will be populated eventually.\nIn the case of a sub-zone, a kubi.zone/parent-zone label is added to the zone resource as well, referencing the\nspecific parent zone.\n\n\nFetch all child Records and compile the zone entries into a list.\n\n\nFind all sub-zones of this one (if any), and then:\n\nCopy all NS records pointing to the sub-zone itself into this list.\nCopy all A and AAAA records of the sub-zone, which relate to the above NS records.\n\n\n\nCompute a hash based on the above entries.\n\n\nIf the above hash has changed from the previously known value, increment the serial\n\n\nInsert an SOA record based on the Zone's .spec and insert it at the top of the entries list.\n\n\nPatch the Zone with the updated entries, hash and serial field.\n\n\nRecords\nWhenever a change to a Record resource is detected, the following process occurs:\n\n\nPopulate the record's .status.fqdn.\nIf the Record has a fully qualified domainName, this field is copied directly.\nOtherwise, the record's parent is retrieved by following its zoneRef after which the .status.fqdn is\npopulated by concatenating the domainName of the record with the .status.fqdn of the parent zone.\n\n\nParent zone is deduced.\n\n\nIf the record does have a zoneRef, then the parent zone is found by looking up the zoneRef and\nvalidating that the zone's delegations allow adoption of this record.\n\n\nIf the record does not have a zoneRef, the parent is deduced by iterating over all zones and\nchecking if any of them match the fully qualified domainName of the record and allow delegation to the record.\nThe parent zone with the longest .status.fqdn is chosen.\nThis means that a record with a fully qualified domain name like www.subdomain.example.org. will be adopted\nby a zone with a .status.fqdn of subdomain.example.org. before a zone whose .status.fqdn is example.org.,\nassuming both zones have delegation rules allowing the adoption.\n\n\nIf successfully deduced, a kubi.zone/parent-zone label is added to the record resource, referencing the parent zone.\n\n\nPropagation\nIn both cases, setting the kubi.zone/parent-zone label on a Record or Zone signifies association with the\nparent zone and will automatically trigger reconciliation of said parent, which in turn will cause the hash, serial\nand entries fields of the zone to be recomputed.\n","id":"https://kubi.zone/docs/v0.1.0/operators/kubizone/","title":"Kubizone Operator"},"https://kubi.zone/docs/v0.1.0/operators/zonefile/":{"body":"Procedure\nWhenever a Zone referenced by a ZoneFile changes,\nthe operator rebuilds the RFC1035-compatible text representation\nof the zone, and creates/updates the ConfigMap with the new data.\n","id":"https://kubi.zone/docs/v0.1.0/operators/zonefile/","title":"Zonefile Operator"}},"docInfo":{"https://kubi.zone/":{"body":0,"title":3},"https://kubi.zone/docs/":{"body":0,"title":1},"https://kubi.zone/docs/v0.1.0/":{"body":0,"title":1},"https://kubi.zone/docs/v0.1.0/custom-resources/":{"body":0,"title":2},"https://kubi.zone/docs/v0.1.0/custom-resources/record/":{"body":314,"title":1},"https://kubi.zone/docs/v0.1.0/custom-resources/zone/":{"body":711,"title":1},"https://kubi.zone/docs/v0.1.0/custom-resources/zonefile/":{"body":204,"title":1},"https://kubi.zone/docs/v0.1.0/getting-started/":{"body":0,"title":2},"https://kubi.zone/docs/v0.1.0/getting-started/installation/":{"body":80,"title":1},"https://kubi.zone/docs/v0.1.0/getting-started/integrating/":{"body":84,"title":1},"https://kubi.zone/docs/v0.1.0/getting-started/introduction/":{"body":247,"title":1},"https://kubi.zone/docs/v0.1.0/getting-started/usage/":{"body":167,"title":1},"https://kubi.zone/docs/v0.1.0/operators/":{"body":0,"title":1},"https://kubi.zone/docs/v0.1.0/operators/kubizone/":{"body":259,"title":2},"https://kubi.zone/docs/v0.1.0/operators/zonefile/":{"body":17,"title":2}},"length":15},"lang":"English"};